exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog"),url=`https://www.aishuge.la/kan/${bid.idPrefix()}/${bid}/`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/id="listsss"/,"</ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)},transformer:f=>f.subRegexMapAll(/data-id="(?<o>\d+)"[^>]*>(?<c>(?:<li[^>]*>\s*<a[^>]*>[^<]*<\/a>\s*<\/li>)+)/g).map(_=>(_.o=parseInt(_.o),_)).sort((a,b)=>a.o-b.o).map(_=>_.c).join("\n")})};